sys_variable_value.value:
(function execute(inputs, outputs) {

  var gutils = new GoogleIdentityAccessUtils();
  var message = gutils.validateTheInputs(inputs);
  if (!message == 'Ok') { 
     throw new Error(message); 
  } 

  inputs = new GoogleIdentityAccessUtils().trimStringInputs(inputs);
  var payload = { 
    roleId: inputs.idOfRole,
    role: { 
        description: inputs.desc,
        title: inputs.title,
        stage: inputs.stage,
        includedPermissions: (inputs.permissions).split(',')            
    }
  }
  outputs.payload = JSON.stringify(payload);  
})(inputs, outputs);

