sys_variable_value.value:
(function execute(inputs, outputs) {
 var responseBody = JSON.parse(inputs.response_body);
  if(inputs.status_code == "200") {
  	outputs.status = "Success";

    outputs.role = responseBody;
    outputs.role.name = responseBody.name;
    outputs.role.title = responseBody.title;
    outputs.role.description = responseBody.description;
    outputs.role.includedPermissions = responseBody.includedPermissions.toString();
    outputs.role.stage = responseBody.stage;
    outputs.role.etag = responseBody.etag;
    outputs.role.deleted = responseBody.deleted;

    outputs.name = responseBody.name;
    outputs.title = responseBody.title;
    outputs.description = responseBody.description;
    outputs.includedPermissions = responseBody.includedPermissions;
    outputs.stage = responseBody.stage;
    outputs.etag = responseBody.etag;
    outputs.deleted = responseBody.deleted;

  } else {
  	outputs.status = "Error";
    outputs.error_message = new GoogleIdentityAccessErrorHandler().handleError(responseBody.error); 
  }
})(inputs, outputs);

